package isola.model.html.phrase;import isola.helpers.ElementParserHtml;import isola.model.html.core.Container;/** *  * Indicates stronger emphasis. *  *  *  * @author Umut Gokbayrak */public class Strong extends Container {	private static final String tag = "strong";		public Strong() {		super();		setId(tag + (Math.random() * 1000));	}		public Strong(String id) {		super(id);	}		@Override	public String toString() {		return ElementParserHtml.getToStringOut(this);	}		public String getTag() {		return tag;	}}